import Link from "next/link";

const NavLink = styled.a`
  margin-left: 20px;
`;

const Nav = () => (
  <div className="nav">
    <Link href="/">
      <a className="nav__link">Home</a>
    </Link>
    <Link href="/about">
      <a className="nav__link">About</a>
    </Link>
  </div>
);

export default Nav;
